package print_java;

public class Overload {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		numbers(2,3);
		numbers(5);
		
		
	}
		
		public static void numbers (int n)
		
		{
			System.out.println(n);
		}
		
		public static void numbers (int n, int p)
		{
			System.out.println(n+p);
		}

	}


